(* ### Problem
 In the figure below, $ABDC,$ $EFHG,$ and $ASHY$ are all squares; $AB=EF =1$ and $AY=5$.

What is the area of quadrilateral $DYES$?

[asy]
size(5cm);
defaultpen(black+1);
pair a=(0,5); pair b=(1,5); pair c=(0,4); pair d=(1,4); pair e=(4,1); pair f=(5,1); pair g=(4,0); pair h=(5,0); pair y=(0,0); pair s=(5,5);
draw(a--s--h--y--a);
draw(c--d--b,gray);
draw(g--e--f,gray);
draw(d--y--e--s--d);
dot(a); dot(b); dot(c); dot(d); dot(e); dot(f); dot(g); dot(h); dot(y); dot(s);
label("$A$",a,NW);
label("$B$",b,N);
label("$C$",c,W);
label("$D$",d,SE);
label("$E$",e,NW);
label("$F$",f,E);
label("$G$",g,S);
label("$H$",h,SE);
label("$Y$",y,SW);
label("$S$",s,NE);
[/asy] The final Answer is 15
 ### Proof
 The large square, $ASHY$, is divided into seven regions. Two of these ($ABDC$ and $EFHG$) are squares. Four of the regions ($BSD,$ $CYD,$ $SFE,$ $YGE$) are right triangles. Finally, the seventh region is $DYES$, the quadrilateral whose area we wish to know.
 Thus, we subtract the area of the first six regions from the area of $ASHY$. $ASHY$ has side length $5$ and therefore has area $5^2=25$. The two small squares each have side length $1$ and thus area $1$.
 The right triangles each have legs of length $1$ and $4$ (since, for example, $CY = AY-AC = 5-1 = 4$).
 Thus, each right triangle has area $\frac{1\cdot 4}{2} = 2$.
 Subtracting the two small squares and the four right triangles from the large square, we determine that the area of $DYES$ is $$25 - 2\cdot(1) - 4\cdot(2) = \boxed{15}.$$
 *)

theorem
fixes AB EF AS AY DYES :: real
assumes h0 : "AB = EF"
and h1 : "AB = 1"
and h2 : "AY = 5"
and h3 : "AS * AS = AY * AY"
and h4 : "AS = AB + EF"
shows  "DYES = 15"
 proof- 
  show ?thesis sledgehammer

